import React from 'react'
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation } from "swiper/modules";
import "Style1.css";
import "swiper/css/navigation";
import "./TestimonialSlider.css";

const testimonials = [
  {
    text: "I was planning a honeymoon and I found a travel agent who was truly unique...",
    name: "Alicia",
    img: "/images/client1.jpg"
  },
  {
    text: "Affordable and reliable! The agent helped me find a great flight and hotel...",
    name: "Mark",
    img: "/images/client2.jpg"
  },
  {
    text: "I had a wonderful time in China! The travel agency did a great job...",
    name: "Alex",
    img: "/images/client3.jpg"
  },
  {
    text: "Very helpful and knowledgeable. They answered all questions...",
    name: "Sophia",
    img: "/images/client4.jpg"
  },
  {
    text: "I had a great time on my trip. Everything was smooth...",
    name: "Emma",
    img: "/images/client5.jpg"
  }
];

export default function TestimonialSlider() {
  return (
      <div>
          
          <div className="testimonial-wrapper">
      <h2>Our Happy Clients</h2>
      <Swiper
        modules={[Navigation]}
        navigation
        slidesPerView={3}
        spaceBetween={30}
        centeredSlides={true}
        className="testimonial-swiper"
      >
        {testimonials.map((item, index) => (
          <SwiperSlide key={index}>
            <div className="testimonial-card">
              <div className="testimonial-bubble">
                <p>{item.text}</p>
              </div>
              <img className="testimonial-avatar" src={item.img} alt={item.name} />
              <h4>{item.name}</h4>
            </div>
          </SwiperSlide>
        ))}
              </Swiper>
              </div>

    </div>
  )
}
